import React from 'react';
import { Container, Typography, Button } from '@mui/material';
import { Link } from 'react-router-dom';

const LandingPage = () => {
  return (
    <Container>
      <Typography variant="h2" gutterBottom>Welcome to the Election App</Typography>
      <Button variant="contained" color="primary" component={Link} to="/candidates">
        View Candidates
      </Button>
    </Container>
  );
};

export default LandingPage;
